import myself from './myself.png';
import './App.css';

function App() {
  return (
    <header>
       <div className="landing-left">
      <h1>Hello , I am Sive Chrestena Ncanywa</h1>
      <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Rerum rem blanditiis et doloribus suscipit. Inventore sit quos ratione temporibus. At.</p>
      </div>
        <div className="image-background"> 
        <img src={myself} className="myself" alt="myself" />
        </div>
        
    
    </header>
  );
}

export default App;
